BEGIN TRANSACTION;
CREATE TABLE "Intradays" ("ID" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL  ,"Symbol" VARCHAR(10)  NOT NULL  ,"Date" DATETIME  NOT NULL  ,"Open" FLOAT(9,3)  NOT NULL  ,"High" FLOAT(9,3)  NOT NULL  ,"Low" FLOAT(9,3)  NOT NULL  ,"Close" FLOAT(9,3)  NOT NULL  ,"Volume" INT  NOT NULL  );
CREATE INDEX 'IX_Intraday_Date' ON 'Intradays' (`Date` DESC);
COMMIT;